const HorizontalList = () => {
  const history = useHistory();

  const handleClick = (item) => {
    history.push(`/items/${item.id}`);
  };
  return (
    <ul>
      {items.map((item) => (
        <li key={item.id} onClick={() => handleClick(item)}>
          {item.name}
        </li>
      ))}
    </ul>
  );
};

export default HorizontalList;
